	@Test
	public void test() {
		Charset charset = Charset.forName("UTF-8");
		int[] uids = new int[] {
			145194, // soggetto: 108297, bankitalia: joint venture
			125153, //soggetto: 2038, incarichi collaborazione
			144935 // soggetto: 123754 : no bankitalia
		};
		Utility.BTL.initBilancio(2019);
		List<String> chunk = new ArrayList<String>(); 
		
		for (int i : uids) {
			System.out.println("elaboro: " + i);
			chunk.add("SubImpegno_uid_" + i);
			//per il test e' stato creato un metodo ad hoc che pero√¨ non va lasciato in impegno bil DAD e quindi e' stato ivi eliminato. lascio comunque la struttura del test per il fururo.
			SubImpegno findSubImpegnoByUidTest = impegnoBilDad.findSubImpegnoByUid(i);
			if(findSubImpegnoByUidTest == null) {
				chunk.add("null");
			}
			ByteArrayOutputStream baos = new ByteArrayOutputStream();
			JAXB.marshal(findSubImpegnoByUidTest, baos);
			String s = baos.toString();
			chunk.add(s);
			System.out.println("elaborato: " + i);
		}
		String united = StringUtils.join(chunk, "\n");
		System.out.println("Fallback:");
		System.out.println("*********************************");
		System.out.println(united);
		System.out.println("*********************************");
		try {
			printTestFileBytes("docs/test/movgest/SIAC-7327-subimpegno_mapping_vecchio.xml", united.getBytes(charset));
		} catch (IOException e) {
			System.out.println("Fallback:");
			System.out.println("*********************************");
			System.out.println(united);
			System.out.println("*********************************");
			System.out.println(e.getMessage());
			e.printStackTrace();
		}
	}
	
